commits.content:
html, body{
    font-family: 'Montserrat', sans-serif;
}
.alert{
    padding: 10px;
    margin:0px;
    color: white;
    text-align:center;
    border:none;
    border-radius:0px;

}
.alert-success{
    background-color: green
}
.alert-error{
    background-red: green
}
.alert-info{
    background-color: blue
}
